import React, { useState } from 'react';
import {
  Carousel,
  CarouselItem,
  CarouselControl,
  CarouselIndicators,
  CarouselCaption,
  UncontrolledCarousel
} from 'reactstrap';

import './CarouselReactStrap.css'

import img1 from './images/présentation.jpg'
import img2 from './images/image1.png'
import img3 from './images/image2.png'

const items = [
  {
    src: img1,
    altText: '',
    caption: ''
  },
  {
    src: img2,
    altText: '',
    caption: '',
  },
  {
    src: img3,
    altText: '',
    caption: ''
  }
];

const CarouselReactStrap = () => <UncontrolledCarousel className='carousel' items={items} />;

export default CarouselReactStrap;
